variables.value:
{
  tooltip: {
    trigger: 'axis',
    axisPointer: {
      type: 'shadow'
    }
  },
  legend: {},
  grid: {
    left: '3%',
    right: '4%',
    bottom: '3%',
    containLabel: true
  },
  xAxis: [{
    type: 'category',
    data: chart_data.fetchData().month
  }],
  yAxis: [{
    type: 'value',
    name: ' Number of applications ',
    interval: 300,
    axisLabel: {
      formatter: '{value} '
    }
