  }, {
    name: 'Card',
    type: 'bar',
    stack: 'Ad',
    emphasis: {
      focus: 'series'
    },
    data: chart_data.fetchData().card_count
  }, {
    name: 'Ultility',
    type: 'bar',
    stack: 'Ad',
    emphasis: {
      focus: 'series'
    },
    data: chart_data.fetchData().utility_count
  }, {
    name: 'Total amount',
    type: 'bar',
    yAxisIndex: 1,
    data: chart_data.fetchData().amount
  }]
